import React, { Component } from 'react';
import './Home.css';
import Footer from './Footer';
import UserInput from './UserInput';
class Home extends Component {
    render() {
        return (
            <div>

                <header className="App-header">
                    <h1>Sorting App</h1>
                    <p style={{ fontFamily: "times new roman" }}> helps u sort ur number ! </p>
                </header>
                <br />
                <UserInput />
                <br />
                <Footer />

            </div>

        );
    }
}

export default Home;
